import { useState } from "react";
import "./App.css";
import ToDoForm from "./components/ToDoForm";

function App() {
  const [todos, setTodos] = useState([]);
  let index = 0;

  return (
    <div className="app">
      <h1>To Do List</h1>
      <ToDoForm />
      <ul className="list">
        {todos.map((todo) => {
          return (
            <li key={todo.id}>
              <label>
                <input type="checkbox" checked={todo.completed} />
                {todo.title}
              </label>
              <button className="btn btn-del">Delete</button>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default App;
